import { httpAction } from '@/api/manage';
import Vue from 'vue';
import axios from 'axios';
import { ACCESS_TOKEN } from "../../../store/mutation-types";
import { JeecgListMixin } from '@/mixins/JeecgListMixin';
export default {
  name: "vtn1",
  mixins: [JeecgListMixin],
  components: {},
  data: function data() {
    return {
      isRadio: false,
      dataSource: [],
      columns: [{
        title: '用户姓名',
        align: "center",
        dataIndex: 'username'
      }, {
        title: '所在部门',
        align: "center",
        dataIndex: 'departs'
      }],
      options: ["同意", "不同意"],
      comment: '',
      isNextTask: false,
      isCommentDo: false,
      isGongWen: false,
      isDownloadAll: false,
      isBack: false,
      nextTasks: [],
      nextUsers: [],
      confirmLoading: false,
      taskId: '',
      comId: 'nextTask',
      title: "操作",
      visible: false,
      url: {
        list: '111',
        nextFormUrl: window._CONFIG['domianURL'] + '/wf/task/nextForm',
        doTaskUsers: window._CONFIG['domianURL'] + '/sys/user/getMsgByRoleName',
        backUrl: window._CONFIG['domianURL'] + '/wf/task/backDone'
      }
    };
  },
  created: function created() {},
  methods: {
    showTask: function showTask(record) {
      this.selectedRowKeys = [];
      var that = this;
      this.taskId = record.id;
      axios.get(this.url.nextFormUrl, {
        params: {
          taskId: this.taskId
        },
        headers: {
          'X-Access-Token': Vue.ls.get(ACCESS_TOKEN)
        }
      }).then(function (response) {
        if (response.data.success) {
          that.nextTasks = response.data.result;
        } else {
          that.$message.error(response.data.message);
        }
      });
      this.visible = true;
    },
    doTaskUsers: function doTaskUsers(v) {
      this.selectedRowKeys = [];

      if (v.isMultiInstance) {
        this.isRadio = false;
      } else {
        this.isRadio = true;
      }

      var roleName = '';

      if (v.candidates.indexOf("'") >= 0) {
        roleName = v.candidates.substring(1, v.candidates.length - 1);
      }

      var that = this;
      axios.get(this.url.doTaskUsers, {
        params: {
          roleName: roleName
        },
        headers: {
          'X-Access-Token': Vue.ls.get(ACCESS_TOKEN)
        }
      }).then(function (response) {
        if (response.data.success) {
          that.nextUsers = response.data.result;
          that.dataSource = response.data.result;
        } else {
          that.$message.error(response.data.message);
        }
      });
      this.showAndClose('isNextTask');
    },
    commentDo: function commentDo() {
      //去后台查 快捷意见
      this.showAndClose('isCommentDo');
    },
    gongWen: function gongWen() {},
    save: function save() {
      this.close();
    },
    back: function back() {//查询可退回节点
    },
    downloadAll: function downloadAll() {},
    close: function close() {
      this.$emit('close');
      this.visible = false;
    },
    handleCancel: function handleCancel() {
      this.close();
    },
    showAndClose: function showAndClose(name) {
      var list = ['isNextTask', 'isCommentDo', 'isGongWen', 'isDownloadAll', 'isBack'];

      for (var i = 0; i < list.length; i++) {
        var v = list[i];

        if (v == name) {
          this[name] = true;
        } else {
          this[v] = false;
        }
      }
    },
    optionSelect: function optionSelect(option) {
      this.comment += option;
      console.log(option);
    },
    clearOptions: function clearOptions() {
      this.comment = '';
    },
    fineshedByHand: function fineshedByHand() {}
  }
};
